import { NOTIFY_TYPES } from "../types/notifyTypes";

export const loginAction = (data) => {
  return async (dispatch) => {
    try {
      dispatch({ type: NOTIFY_TYPES.NOTIFY, payload: { loading: true } });
    } catch (err) {}
  };
};
